"use strict";(self.webpackChunk_N_E=self.webpackChunk_N_E||[]).push([[640],{5640:e=>{e.exports=JSON.parse('{"header":{"title":"أوتلوكس","home":"الرئيسية","dashboard":"الحسابات","contact":"تواصل معنا","docs":"مركز المساعدة"},"landing":{"title":"وداعاً للاشتراكات المدفوعة","description":"نقدم لك حسابات متاحة للجميع لأشهر الخدمات. استمتع بالميزات المدفوعة دون الحاجة للدفع مجدداً.","get_started":"استكشف الحسابات"},"home":{"title":"الحسابات المتاحة","description":"هنا قائمة بالحسابات المتاحة. قم بتوسيع أي حساب لرؤية المزيد من التفاصيل.","noAccounts":"لا توجد حسابات حالياً","noAccounts_desc":"يتم إضافة حسابات جديدة بشكل مستمر. يرجى التحقق مرة أخرى قريباً!","error":"فشل تحميل الحسابات","error_desc":"حدثت مشكلة أثناء الاتصال بقاعدة البيانات. يرجى المحاولة مرة أخرى لاحقًا.","account_prefix":"حساب رقم","email":"البريد الإلكتروني","password":"كلمة المرور","country":"الدولة","services":"الخدمات المرتبطة","posted_today":"أُضيفت اليوم","posted_previously":"أُضيفت سابقًا","copied_to_clipboard":"تم النسخ إلى الحافظة","services_toast_title":"ملاحظة حول الخدمات المرتبطة","services_toast_message":"خاصية كشف الخدمات لدينا ليست دقيقة 100%. نوصي باستكشاف الحساب بنفسك للعثور على جميع الاشتراكات.","copy_button":"نسخ","copied_button":"تم النسخ!","check_account_button":"التحقق من الصلاحية"},"contact":{"title":"تواصل معنا","description":"هل لديك سؤال أو ملاحظة؟ املأ النموذج أدناه وسنراجع رسالتك.","telegram_user":"اسم مستخدم تليجرام","telegram_user_placeholder":"username","message":"الرسالة","message_placeholder":"رسالتك هنا...","submit":"إرسال الرسالة","submitting":"جاري الإرسال...","success_title":"تم إرسال الرسالة!","success_message":"شكراً لرسالتك. لقد استلمناها وسنرد عليك عبر تليجرام إذا لزم الأمر.","error_title":"خطأ","error_telegram_message":"اسم مستخدم تليجرام مطلوب.","error_message_message":"الرسالة يجب أن تكون 10 أحرف على الأقل.","error_general_message":"حدث خطأ غير متوقع. الرجاء المحاولة مرة أخرى."},"docs":{"title":"مركز المساعدة","description":"دليلك الكامل للبدء في استخدام موقعنا وخدماتنا بفعالية وأمان.","how_it_works":{"title":"آلية العمل: ثلاث خطوات بسيطة","step1":"تصفح الحسابات المتاحة في لوحة التحكم. كل بطاقة تمثل حسابًا يمكنك استخدامه.","step2":"اضغط على زر \'التحقق من الصلاحية\' للحساب الذي تريده. هذا يرسل طلبًا إلى البوت الذكي الخاص بنا.","step3":"سيقوم بوت التليجرام بالتحقق فورًا من حالة الحساب وإرسال التفاصيل الكاملة لك (بما في ذلك كلمة المرور والخدمات المرتبطة) إذا كان نشطًا. هذا يضمن أنك لن تحصل على حساب غير صالح أبدًا."},"safety_guide":{"title":"الأمان وأفضل الممارسات","description":"لضمان تجربة سلسة وعادلة للجميع، يعد اتباع إرشادات المجتمع هذه إلزاميًا. توجد هذه القواعد لحماية استمرارية الحسابات والمجتمع.","point1":"لا تقم أبدًا بتغيير كلمة المرور. هذا هو أهم قاعدة. تغيير كلمة المرور يمنع أي شخص آخر من الدخول وسيؤدي إلى حظر فوري ودائم من خدمتنا.","point2":"لا تقم بتخزين أي معلومات شخصية أو حساسة على هذه الحسابات. إنها مشتركة، لذا افترض أن أي شيء تضيفه يمكن للآخرين رؤيته. استخدمها لميزاتها المميزة فقط.","point3":"تأتي جميع الحسابات مع وصول كامل إلى صندوق بريد Outlook. لا تتردد في استخدام هذا للتسجيل في خدمات أخرى أو لعمليات التحقق عبر البريد الإلكتروني، ولكن لا تستخدمه للمراسلات الشخصية."},"basics":{"title":"أساسيات الاستخدام","questions":{"q1":{"q":"ما الهدف من هذا الموقع؟","a":"Outloox هي منصة تعليمية مصممة لتوفير وصول شفاف إلى حسابات مشتركة للخدمات الشائعة. تتيح للمستخدمين استكشاف الميزات المميزة دون الحاجة إلى اشتراك. ما يميزنا هو نظام التحقق الفوري، الذي يضمن أن الحسابات التي تتلقاها نشطة وتعمل."},"q2":{"q":"كيف أحصل على كلمة مرور الحساب؟","a":"يتم إرسال كلمة المرور، إلى جانب البريد الإلكتروني وتفاصيل أخرى، بواسطة بوت التليجرام الخاص بنا *بعد* الضغط على زر \'التحقق من الصلاحية\'. تضمن هذه العملية المكونة من خطوتين أنك تتلقى فقط بيانات الاعتماد للحسابات التي تم التأكد من أنها تعمل في تلك اللحظة بالضبط، مما يوفر لك الوقت والإحباط."},"q3":{"q":"هل الخدمة مجانية؟","a":"نعم، استخدام Outloox مجاني تمامًا. لا توجد اشتراكات أو تكاليف خفية. نحن نحافظ على الخدمة لأغراض تعليمية ومجتمعية. لضمان وصول عادل للجميع، قد نطبق حدود استخدام يومية."},"q4":{"q":"هل يمكنني استخدام البوت مباشرة على تليجرام؟","a":"نعم، يمكنك ذلك! البوت متاح على مدار الساعة طوال أيام الأسبوع لإجراء عمليات تحقق سريعة. إذا كان لديك بريد إلكتروني وكلمة مرور تريد التحقق منهما، يمكنك إرسالهما مباشرة إلى البوت بتنسيق `email:password`. ومع ذلك، لتصفح حسابات جديدة والحصول على أفضل تجربة، نوصي دائمًا بالبدء من لوحة التحكم على الويب."}}},"verification_process":{"title":"عملية التحقق","questions":{"q1":{"q":"ماذا يفعل زر \'التحقق من الصلاحية\'؟","a":"عندما تضغط على هذا الزر، فإنه يبدأ عملية تحقق في الوقت الفعلي. يحاول البوت الخاص بنا تسجيل الدخول إلى الخدمة باستخدام بيانات اعتماد الحساب. إذا نجح، فإنه يجمع تفاصيل مثل اسم صاحب الحساب وبلد المنشأ والخدمات المرتبطة (مثل Netflix). إنه ذكي بما يكفي للتمييز بين أنواع الفشل المختلفة، مثل كلمة مرور خاطئة أو حساب مقفل أو خطأ في الشبكة، وسيقوم بإبلاغك بالمشكلة المحددة."},"q2":{"q":"هل الحسابات التي أتلقاها آمنة؟","a":"\'الأمان\' هنا يعني أن المنصة نفسها آمنة، وليس الحسابات الفردية. نحن نوفر وصولًا شفافًا ونتحقق من بيانات الاعتماد للتأكد من أنها تعمل وندير الحسابات. تقع على عاتقك مسؤولية اتباع قواعد المجتمع: لا تقم بتغيير كلمات المرور ولا تقم بتخزين بيانات شخصية حساسة. فكر فيها ككتب في مكتبة—متاحة للجميع للاستخدام، ولكن ليس للاحتفاظ الشخصي."}}},"troubleshooting":{"title":"استكشاف الأخطاء وإصلاحها","questions":{"q1":{"q":"ماذا أفعل إذا لم يعمل الحساب؟","a":"أولاً، استخدم زر \'التحقق من الصلاحية\' للحصول على أحدث بيانات الاعتماد من البوت، حيث قد لا تكون المعلومات على الموقع قد تم تحديثها بعد. السبب الأكثر شيوعًا لعدم عمل الحساب هو أن كلمة المرور قد تم تحديثها مؤخرًا من قبل المشرفين لدينا."},"q2":{"q":"أخبرني البوت أن الحساب \'لم يعد صالحًا\'. ماذا يعني ذلك؟","a":"هذا يعني أن فحص التحقق الفوري لدينا قد فشل. من المحتمل أن الحساب كان يعمل من قبل، لكنه لم يعد قابلاً للوصول الآن. الأسباب الشائعة تشمل: تم تغيير كلمة المرور من قبل مشرف، أو تم قفل الحساب من قبل مزود الخدمة، أو تم إزالته من نظامنا. هذا هو نظام التحقق الذي يعمل على النحو المنشود—لقد منعك من تلقي حساب لا يعمل. ببساطة، انتقل إلى حساب آخر وجرب من لوحة التحكم."},"q3":{"q":"الموقع لا يتم تحميله أو أنه فارغ. ما المشكلة؟","a":"إذا عرضت لوحة التحكم \'لا توجد حسابات\'، فهذا أمر طبيعي في كثير من الأحيان حيث يتم تحديث قائمة حساباتنا باستمرار. تحقق مرة أخرى قريبًا بحثًا عن إضافات جديدة. إذا لم يتم تحميل الموقع بأكمله، فجرب الخطوات التالية: 1) قم بتحديث الصفحة. 2) امسح ذاكرة التخزين المؤقت لمتصفحك. 3) تحقق من اتصالك بالإنترنت. إذا استمرت المشكلة، فيرجى استخدام صفحة الاتصال لإعلامنا."}}}},"footer":{"rights_reserved":"جميع الحقوق محفوظة."}}')}}]);